class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        current_num = 0
        max_num = 0
        print(len(nums))
        for i in nums:
            if i == 1:
                current_num += 1
            else:
                if current_num > max_num:
                    max_num = current_num
                current_num = 0
        if current_num > max_num:
            max_num = current_num
        return max_num

